import React from 'react';
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";
import EmojiFlagsIcon from '@material-ui/icons/EmojiFlags';
import LocalHospitalIcon from '@material-ui/icons/LocalHospital';
import PeopleIcon from '@material-ui/icons/People';
import ChatIcon from '@material-ui/icons/Chat';
import StorefrontIcon from '@material-ui/icons/Storefront';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
import ExpandMoreOutlinedIcon from '@material-ui/icons/ExpandMoreOutlined';


function Sidebar() {
    return <div className="sidebar">
        <SidebarRow src="https://lh3.googleusercontent.com/a-/AOh14GglKmBwN7b62iLZ9jX1J8B8Gn4_xYRl55_pQBtd=s96-c-rg-br100"  
        title="Pacis Stellan" 
        />
          <SidebarRow Icon = {LocalHospitalIcon}
          title="COVID-19 Information Center"
        />
        <SidebarRow Icon = {EmojiFlagsIcon}
          title="Pages"
        />
        <SidebarRow Icon = {PeopleIcon}
          title="Friends"
        /> 
        <SidebarRow Icon = {ChatIcon}
          title="Messenger"
        />
        <SidebarRow Icon = {StorefrontIcon}
          title="Marketplace"
        />
        <SidebarRow Icon = {VideoLibraryIcon}
          title="Videos"
        />
        <SidebarRow Icon = {ExpandMoreOutlined}
          title="Marketplace"
        />
    </div>
}

export default Sidebar
